import React from "react";
import { Container } from "react-bootstrap";

function Projects() {
    return (
        <Container fluid>
            <main className="mt-3">
                <h2 className="projectsHeader">
                    Projects
                </h2>

            </main>
            <aside>
                <a href="/projects/1">Project 1</a>
            </aside>
        </Container>
    )
}

export default Projects
